import './css/buttons.css'

export default function ActionMenu() {

  return (
      <div className="buttons">
        <button id="actionbutton" class="button">Buy a House</button>
        <button id="actionbutton" class="button">Sell a House</button>
        <button id="actionbutton" class="button">Rent a House</button>
      </div>
  )
}
